import React, {useContext, useEffect} from "react";
import {ApiContext} from "../context/ApiContext"

export default function Prueba() {
    const api = useContext(ApiContext)
    
    useEffect(()=>{
        
        api.getUser().then(response => { console.log(response.data);  })
    })


    return (
        <div>
            {api}
        </div>
    )
}
